import "../css/doctor-side-menu.css";
import RightChevron from "../icons/right-chevron";
import "../scripts/doctor-side-menu";

const DoctorSideMenu = () => {
  return (
      <div className="d-flex">
      <div className="col-1 side-menu-sm">
            <RightChevron/>
      </div>
    <div className="side-menu col-2 vh-100">
      <div className="side-menu-item">
        <span>Home</span>
      </div>
      <div className="side-menu-item">
        <span>Messages</span>
      </div>
      <div className="side-menu-item">
        <span>Appointments History</span>
      </div>
      <div className="side-menu-item">
        <span>Invoices</span>
      </div>
      <div className="side-menu-item">
        <span>Manage Payment Methods</span>
      </div>
      <div className="side-menu-item">
        <span>Saved Products</span>
      </div>
    </div>
    </div>
  );
};

export default DoctorSideMenu;
